import React, { useState } from 'react';
import './nav.css';


const Navbar = () => {
  var splitPath = window.location.pathname.split('/');

  return (
    <nav>
      <ul>
        <li className={splitPath[1] === "" ? "check" : ""}><a href='/'>Home</a></li>
        <li className={splitPath[1] === "movies" ? "check" : ""}><a href='/movies'>Movies</a></li>
        <li className={splitPath[1] === "blog" ? "check" : ""}><a href='/blog'>Blog</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
